-- ----------------------------
-- Table structure for macs_collector
-- ----------------------------
DROP TABLE IF EXISTS `macs_collector`;
CREATE TABLE `macs_collector`  (
  `id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `code` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '编号',
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '名称',
  `location_code` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '位置(0内侧,1外侧...)',
  `door_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '关联门id',
  `device_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '关联设备id',
  `device_port` int(4) NULL DEFAULT NULL COMMENT '关联设备位置',
  `status` int(2) NULL DEFAULT NULL COMMENT '设备状态(0未连接,1正常,2读取,3故障...)',
  `type` int(2) NULL DEFAULT NULL COMMENT '采集设备类型(1读取设备,2读写设备)',
  `description` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '描述/备注',
  `connection_information` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '连接信息',
  `create_by` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '更新人',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `c_device_id`(`device_id`) USING BTREE,
  INDEX `c_door_id`(`door_id`) USING BTREE,
  CONSTRAINT `macs_collector_ibfk_1` FOREIGN KEY (`device_id`) REFERENCES `macs_device` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `macs_collector_ibfk_2` FOREIGN KEY (`door_id`) REFERENCES `macs_door` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '(通行卡,人脸,指纹)采集器' ROW_FORMAT = Dynamic;

