-- ----------------------------
-- Table structure for macs_collector_strategy
-- ----------------------------
DROP TABLE IF EXISTS `macs_collector_strategy`;
CREATE TABLE `macs_collector_strategy`  (
  `id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键id',
  `collector_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '设备id',
  `strategy_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '策略id',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `ds_collector_id`(`collector_id`) USING BTREE,
  INDEX `ds_strategy_id`(`strategy_id`) USING BTREE,
  CONSTRAINT `macs_collector_strategy_ibfk_1` FOREIGN KEY (`collector_id`) REFERENCES `macs_collector` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `macs_collector_strategy_ibfk_2` FOREIGN KEY (`strategy_id`) REFERENCES `macs_strategy` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '设备策略' ROW_FORMAT = Dynamic;

