-- ----------------------------
-- Table structure for macs_visitor_region
-- ----------------------------
DROP TABLE IF EXISTS `macs_visitor_region`;
CREATE TABLE `macs_visitor_region`  (
  `id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键id',
  `visitor_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '访客id',
  `region_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '区域id',
  `application_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '访客申请id',
  `effective_date` datetime NULL DEFAULT NULL COMMENT '生效日期',
  `invalid_date` datetime NULL DEFAULT NULL COMMENT '失效日期',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `vr_visitor_id`(`visitor_id`) USING BTREE,
  INDEX `vr_region_id`(`region_id`) USING BTREE,
  INDEX `vr_application_id`(`application_id`) USING BTREE,
  CONSTRAINT `macs_visitor_region_ibfk_1` FOREIGN KEY (`application_id`) REFERENCES `macs_access_application` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `macs_visitor_region_ibfk_2` FOREIGN KEY (`region_id`) REFERENCES `macs_region` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `macs_visitor_region_ibfk_3` FOREIGN KEY (`visitor_id`) REFERENCES `macs_visitor` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

